import React, {useEffect, useState} from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import {getStorageItem} from 'utils/sessionstorage';

import SitterJob from 'components/Jobs/SitterJob';

const GetSitterJobs = () => {
    
    useEffect(() => {
        sendJobData();
        return () => {
        };
      }, []);
    
    const [resData, setResData] = useState();
    const sendJobData = async () => {
    
        const AUTH_TOKEN = 'Token ' + getStorageItem('jwtToken');
        // axios로 통신
        try {
            axios.defaults.headers.common['Authorization'] = AUTH_TOKEN;   
            const response = await (await axios.get('/api/sitterJobs/'));
            //console.log('response 확인 ', JSON.stringify(response));
            const {
                data: resData,
            } = response;
            setResData(resData);
            
            
        } catch (e) {
            if (e.response) {
                const { data } = e.response;
                console.error(data);
            }
        }
    };

    
    
    return (
        <div> 
            <ul>
                {resData && resData.map(data =>
                   <SitterJob id={data.id} title={data.title} />
                )}
            </ul>
        </div>        
    );

}

export default GetSitterJobs;
